import React from 'react';
import Header from '../components/Header';
import Filter from '../components/Filter';
import RetreatList from '../components/RetreatList';
import Footer from '../components/Footer';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <Header />
      <main>
        <Filter />
        <RetreatList />
      </main>
      <Footer />
    </div>
  );
};

export default App;
